import './App.css';
let sudo = true
let isRuby = true

function App() {
  return (
    <div className="App">
      {/*Ternary operation, if root then 1st statement, else 2nd statement*/}
      {sudo === true ? <h1>Welcome root</h1> : <h1>Welcome user</h1>}
      <h1 style={{color: "aqua",backgroundColor: "grey"}}>Colored text</h1>

      <h1 style={{color: isRuby ? "red" : "aqua",backgroundColor: "grey"}}>Colored text</h1>

      {isRuby ? <button onClick={!isRuby}>Change to aqua</button> : <button onClick={isRuby}>Change to ruby</button>}

      <button onClick={console.log("hello test")}>Test</button>
      {/*Components use these attributes as props*/}
      <User name="Tux" age={12} email="tux@tux.com"/>
      <Job salary={30000} position="Developer" company="Linux"/>
      <User name="RedHat" age={50} email="redhat@rh.com"/>
      <Job salary={10000} position="Sys admin" company="RedHat Enterprise Linux"/>

    </div>
  );
}

// The following is a representation of props if it was a simple js object
// const props = {
//     name: "Tux",
//     Age: 12,
//     email: "tux@tux.com"
// }

const User = (props) =>{
    return(
        <div>
            <h1 className="name">{props.name}</h1>
            <h1>{props.age}</h1>
            <h1>{props.email}</h1>
        </div>
    );
};

const Job = (props) => {
    return(
        <div>
            <p>{props.salary}</p>
            <p>{props.position}</p>
            <p>{props.company}</p>
        </div>
    );
};
export default App;
